import { makeStyles } from "@mui/styles";

export default makeStyles({
  modal: {
    background: 'rgb(39, 41, 50, 40%)',
    width: '500px',
    height: '200px',
    margin: '0 auto',
    marginTop: '50vh',
    transform: 'translateY(-50%)'
  }
});
